import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; 
import App from './App.js';
import ContactUs from './components/contact.jsx';
import Newsletters from './Newsletters';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <ContactUs />
    <Newsletters />
  </React.StrictMode>,
  document.getElementById('root')
);
